import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
    return (
        <div className="bg-gray-100 min-h-screen flex flex-col justify-center items-center">
            <h1 className="text-gray-800 text-4xl font-serif mb-8">Data Entry Forms</h1>

            <div className="flex flex-col gap-4">
                <Link to="/Emp_TC" className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                    Emp_TC
                </Link>
                <Link to="/Emp_TC_OPT" className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                    Emp_TC_OPT
                </Link>
                <Link to="/Emp_master" className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                    Emp_master
                </Link>
                <Link to="/STUDENT_MASTER" className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                    STUDENT_MASTER
                </Link>
                {/* Add more links as needed */}
            </div>
        </div>
    );
}

export default Home;
